import React from "react";

import "./First.css"


const First=()=>{
    return(
        <>
            <div class="navbar">
  <ul>
    <li><a href="#">Home</a></li>
    <li><a href="#">About</a></li>
    <li><a href="#">Services</a></li>
    <li><a href="#">Contact</a></li>
  </ul>
</div>

<div class="content">
  {/* <!-- Main content of the page --> */}
</div>

        </>
    )
}


export default First;
